import React from 'react'; 
import './home.css'

function Home (){ 
	return (
	     <div>
			<h1>User Detials</h1> 


			<form action="" method="">
					<input class="text" type="text" name="Username" placeholder="Username" required=""></input>
					<input class="text email" type="email" name="email" placeholder="Email" required=""></input>
					<input class="text" type="password" name="password" placeholder="Password" required=""></input>
					<input class="text w3lpass" type="password" name="password" placeholder="Confirm Password" required=""></input>


				</form>
				<p>Don't have an Account? <a href="#"> Login Now!</a></p>
			</div>


	);


} 

export default Home;
